    "Dynamics of understory biomass in Sitka spruce-western hemlock forests of southeast
    Alaska",nt"tracking_summary": {ntt"total": 3,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T23:02:46.758880",nt"name":
    "dynamics-of-understory-biomass-in-sitka-spruce-western-hemlock-forests-of-southeast-alaska",nt"isopen":
    false,nt"url": null,nt"notes": "Several understory communities display
    successional stages during the first 200 years after logging or fire disturbance
    in the Coastal Picea-Tsuga forests of southeast Alaska. Residual shrubs and tree
    seedlings increase their growth exponentially after overstory removal. Understory
    biomass peaks about 15 to 25 years after logging. Vascular plants are virtually
    eliminated from the understory after forest canopies close at stand ages of 25 to
    35 years. Bryophytes and ferns dominate understory biomass during the following
    century. An understory of deciduous shrubs and herbs is reestablished after 140
    to 160years. Thereafter, biomass of the vascular understory continues to increase,
    while bryophyte biomass and tree productivity decline. Departures from this developmental
    sequence are related to unusual types of stand establishment, soil, microclimate,
    or disturbance.",nt"license_title": "License Not Specified",nt"extras":
